    "# Step 2: To add more insight, let’s calculate the interquartile range (IQR) for each region.\n",
    "# This will give us a clearer understanding of the spread and highlight regions with more variability.\n",
    "ev_stock_share['iqr'] = ev_stock_share.groupby('region')['value'].transform(lambda x: x.quantile(0.75) - x.quantile(0.25))\n",
